import React , { Component } from 'react';
import './App.css';
import Register from "./Components/Register";
import List from "./Components/List";

export class App extends Component {
  constructor(props) {
    super(props)

    this.state = {
       isRegistered: false,
    };
  }
  render() {
    return 
      <div>
        { this.state.isRegistered ?<List></List> : <Register></Register>
        }
      </div>

  }
}

export default App;
